ol isOptSuccess          = false;\nObjective objective    = FIRST_ORDER;\nconst bool isStatRequested = false;\nbool isStatSuccess         = false;\n\n///////////////////////////////////////////////////////////////////\n// NONMEM Sepcific\nconst int nTheta          = 3; // length of theta vector\ndouble c_thetaIn[nTheta]  = { 3, .08, .04 };\nconst valarray<double> thetaIn( c_thetaIn, nTheta );\ndouble c_thetaUp[nTheta]  = { 5, .5, .9 };\nconst valarray<double> thetaUp( c_thetaUp, nTheta );\ndouble c_thetaLow[nTheta] = { .1, .008, .004 };\nconst valarray<double> thetaLow( c_thetaLow, nTheta );\nvalarray<double> thetaOut( nTheta );\n\nconst int nOmega         = 6; // #of elements in Omega matrix\nconst int dimOmega       = 3; // dimension of Omeaga matrix\ndouble c_omegaIn[nOmega] = { 6, .005, .0002, .3, .006, .4 };\nconst valarray<double> omegaIn( c_omegaIn, nOmega );\nvalarray<double> omegaOut( nOmega );\n\nconst int nSigma         = 1; // #of elements in Sigma matrix\nconst int dimSigma = 1; // order of Sigma matrix\nconst int nEps           = dimSigma;\ndouble c_sigmaIn[nSigma] = { .4 };\nconst valarray<double> sigmaIn ( c_sigmaIn, nSigma );\nvalarray<double> sigmaOut( nSigma );\n\nconst int nEta              = 3;\ndouble c_etaIn[nEta] = { 0.0, 0.0, 0.0 };\nconst valarray<double> etaIn ( c_etaIn, nEta );\nvalarray<double> etaOut( nEta );\nvalarray<double> etaAllOut( nEta * nPop );\n\n//\n///////////////////////////////////////////////////////////////////\n\n///////////////////////////////////////////////////////////////////\n//   NONMEM PRED Specific\nPred< CppAD::AD<double> > mPred(&set);\nenum PopPredModel::covStruct omegaStruct = PopPredModel::FULL;\nenum PopPredModel::covStruct sigmaStruct = PopPredModel::DIAGONAL;\nPopPredModel model( mPred,\n                    nTheta,\n                    thetaLow,\n                    thetaUp,\n                    thetaIn,\n                    nEta,\n                    etaIn,\n                    nEps,\n                   