ed in parameter estimation!!!\";\n     oRuntimeError << message << endl;\n     cerr << message << endl;\n     isOptSuccess = false;\n     FpErrorChecker::clear();\n  }\n  gettimeofday( &optEnd, NULL );\n  optTimeSec = difftime( optEnd.tv_sec, optBegin.tv_sec );\n\n  //////////////////////////////////////////////////////////////////////\n  //   NONMEM Specific\n  if( isOptSuccess || !isOptSuccess )\n  {\n     valarray<double> ROut( nY * nY );\n     model.getTheta( thetaOut );\n     model.getOmega( omegaOut );\n     model.setIndPar( bOut );\n     model.dataVariance( ROut );\n     for( int j=0; j<nY; j++ )\n        set.data[0]->res[j]  = y[j] - set.data[0]->pred[j];\n     set.data[0]->wres = wres( nY, ROut, set.data[0]->res ); \n  }\n  //\n  //////////////////////////////////////////////////////////////////////\n}\n\n/*******************************************************************/\n/*                                                                 */\n/*   ReportML Document                                             */\n/*                                                                 */\n/*******************************************************************/\nofstream oResults( \"result.xml\" );\nif( !oResults.good() )\n{\n   fprintf( stderr, \"Failed to open a file, %s !!!\", \"result.xml\" );\n   return FILE_ACCESS_FAILURE;\n}\noResults << \"<?xml version=\\\"1.0\\\"?>\" << endl;\noResults << \"<spkreport>\" << endl;\n\nchar buf[ SpkError::maxMessageLen() ];\nifstream iRuntimeError( \"spk_error.tmp\" );\noResults << \"<error_message>\" << endl;\nwhile( iRuntimeError.good() )\n{\n   iRuntimeError.getline(buf, SpkError::maxMessageLen() );\n   oResults << buf << endl;\n}\noResults << \"</error_message>\" << endl;\niRuntimeError.close();\n\nif( !haveCompleteData )\n{\n   oResults << \"</spkreportML>\" << endl;\n   oResults.close();\n   return OTHER_FAILURE;\n}\n\noResults << \"<ind_analysis_result>\" << endl;\n\noResults << \"<ind_opt_result elapsedtime=\\\"\" << o