;\n   valarray<double> C( 0.0, n * n );\n   C = cholesky( Ri, n );\n   valarray<double> w = multiply( C, n, r, 1 );\n   vector< CppAD::AD<double> > Cr(n);\n   for( int i=0; i<n; i++ ) Cr[i] = w[i];\n   return Cr;\n}\n\nint main( int argc, const char argv[] )\n{\n/*******************************************************************/\n/*                                                                 */\n/*   Set up                                                        */\n/*                                                                 */\n/*******************************************************************/\nofstream oRuntimeError( \"spk_error.tmp\" );\nif( !oRuntimeError.good() )\n  {\n      fprintf( stderr, \"%s:%d: Failed to create a temporary file, %s.\",  __FILE__, __LINE__, \"spk_error.tmp\" );\n      return FILE_ACCESS_FAILURE;\n  }\n\n//FpErrorChecker fperror;\n\nconst int nY = 128;\nDataSet< CppAD::AD<double> > set;\n\nconst bool isSimRequested = false;\nbool haveCompleteData = true;\n\nconst bool isOptRequested = true;\nbool isOptSuccess  = false;\n\nconst bool isStatRequested = false;\nbool isStatSuccess = true;\n\n//////////////////////////////////////////////////////////////////////\n//   NONMEM Specific\n\nconst int nTheta = 3;\n\ndouble c_thetaIn[nTheta] = { 2.5, 0.000000005, -0.05 };\nconst valarray<double> thetaIn ( c_thetaIn, nTheta );\n\ndouble c_thetaUp[nTheta] = { 25, 0.00000005, -0.005 };\nconst valarray<double> thetaUp  ( c_thetaUp, nTheta );\n\ndouble c_thetaLow[nTheta] = { 0.25, 0.0000000005, -0.5 };\nconst valarray<double> thetaLow ( c_thetaLow, nTheta );\n\nvalarray<double> thetaStep( nTheta );\n\nvalarray<double> thetaOut( nTheta );\n\nconst int nEta     = 1;\nconst int nOmega   = 1; // #of elements in Omega matrix\nconst int dimOmega = 1; // dimension of Omeaga matrix\ndouble c_omegaIn[nOmega] = { 1 };\nconst valarray<double> omegaIn( c_omegaIn, nOmega );\nvalarray<double> omegaOut( nOmega );\n\n//\n////////////////////////////////////